import React from "react";
import "../../../../Styles/Pages/MonsterArena/MonsterContent/MonsterContentCard.scss";
import monsterContentImg1 from "../../../../Assets/svg/monsterContentImg1.svg";

function MonsterContentCard() {
  return (
    <div className='monsterContentCard'>
      <div className='monsterContentCard__bgImage'></div>
      <div className='topBlue'>
        <h4>ddv</h4>
      </div>
      <div className='downContent'>
        <div className='subtitleContentCard'>
          <img src={monsterContentImg1} alt='' />
          <p>Tainttalon</p>
        </div>
      </div>
    </div>
  );
}

export default MonsterContentCard;
